import React from "react";
import { Link } from "react-router-dom";
import {useEffect, useState} from 'react';
import { navLinks } from "./src/navlinks";

const Navbar = () => {
    const [active, setActive]=useState("") 

    return ( 
        <nav className='p-4 no-underline w-full flex items-center py-5 fixed top-0 z-20'>
             <div className='w-full flex justify-between items-center max-w-7xl mx-auto'>
            <img src="" alt="LOGO" className='w-12 h-12 object-contain' />
        <ul className='list-none hidden sm:flex flex-row gap-10'>
        {navLinks.map((link) =>(
            <li 
            key={link.id}
            className={`${
              active === link.title
              ? "text-white"
              : "text-secondary"
            } hover:text-green text-[22px] font-medium cursor-pointer `}
            onClick={() => setActive(link.title)}
            >
              <a href={`#${link.id}`}>{link.title}</a>
            </li>
          ))}
        </ul>
        </div>
       </nav> 
     );
}
 
export default Navbar;
